#
# Structure for table "stock_entry"
#

DROP TABLE IF EXISTS `stock_entry`;
CREATE TABLE `stock_entry` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) DEFAULT NULL,
  `courier_center_id` int(11) DEFAULT NULL,
  `quantity` int(11) DEFAULT NULL,
  `manufacture_date` date DEFAULT NULL,
  `expiry_date` date DEFAULT NULL,
  `entry_date` date DEFAULT NULL,
  `invoice_number` varchar(255) DEFAULT NULL,
  `shop_name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `unique_stock` (`product_id`,`courier_center_id`,`invoice_number`,`expiry_date`)
) ENGINE=InnoDB AUTO_INCREMENT=315 DEFAULT CHARSET=latin1;

